export default {
  userId(state) {
    return state.userId;
  },
  token(state) {
    return state.token;
  },
  isAuthenticated(state) {
    return !!state.token
  },
  getUserFullName(state){
    return state.userFullname;
  },
  didAutoLogout(state){
    return state.didAutoLogout;
  }

};
